import React from "react";
import TopNavBar from "./Navbar";
import Videos from "./Videos";

class Home extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <TopNavBar />
        <br></br>
        <Videos />
      </div>
    );
  }
}

export default Home;
